De hoofdrol wordt gespeeld door Damian Lewis die iedereen kent uit de serie Homeland waar hij ook de hoofdrol voor zijn rekening nam.



Life is een Amerikaans politieserie serie van de zender NBC. De serie ging in premiÃƒÂ¨re op 26 september 2007.

Life is een met een twist. De meeste politieseries behandelen iedere week een andere zaak, die de hoofdpersonen moeten oplossen. Als dit boeiende zaken zijn, maakt het meestal de serie boeiend.

In Life is er meer aan de hand. De hoofdpersoon, Charlie Crews, is terug bij de
politie na een afwezigheid van twaalf jaar. In die tijd heeft hij onterecht gevangen gezeten, een ervaring die hem heeft veranderd voor het leven. Vanuit zijn unieke perspectief kunnen politiezaken er net even anders uitzien.

Een agent die twaalf jaar tussen de criminelen heeft gezeten weet meer dan anderen hoe criminelen denken en is zelf misschien wel een beetje gaan denken zoals zij. Dat kan hem helpen bij het oplossen van misdaden. De keerzijde van jaren onterecht opgesloten te hebben gezeten.

